import Nav from "./nav";

const TheHeader = styled.div`
  width: 100%;
  height: auto;
  background-color: red;
`;

const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

const Header = () => (
  <TheHeader className="header">
    <Title>Little Digital Library</Title>
    <Nav />
  </TheHeader>
);

export default Header;
